INSERT INTO `igdc` (`id_peserta`, `id_ketua`, `tim`, `anggota1`, `anggota2`, `judul`, `deskripsi`, `video`, `game`, `kartu_id`, `status_bayar_igdc`, `hadir_igdc`) VALUES
(1, 1, 'Webmaster', '-', '-', 'Tester', 'Ini cuman nge-test aja kok', 'rajamuda.agri.web.id', 'canIhackIt.com', 'pdf', 0, 0),
(2, 106, 'Faker', 'Noufal Syaiza Rusmawan', 'Danial Abdurrahman', 'Rush and Raid', 'Game ini berkisah tentang seseorang yang ingin mendapatkan figure dan dijual secara limited edition.karena tempat tinggalnya jauh jadi,untuk mendapatkannya dia harus melewati banyak rintangan dan jebakan', 'https://youtu.be/nbF5ElvaC9M', 'https://drive.google.com/open?id=0B6TokkwcmNPpNWQ1ZTRPOC11clk', 'img/identitas/igdc/37015_identitas.pdf', 1, 0),
(4, 112, 'Narma Studio', 'IDMA Krisna Pradyana', 'Mochammad Rizal Al Anshori', 'Rogue Slime Domination', 'Anggota berisi mahasiswa dalam 1 kampus, yakni Politeknik Elektronika Negeri Surabaya', 'https://youtu.be/2f5oSN_rjdw', 'https://play.google.com/store/apps/details?id=com.narmastudio.rogueslimedominator', 'img/identitas/igdc/4210131013_identitas.pdf', 1, 0),
(5, 125, 'Nebula Studio', 'Gibran Haq ', 'Vienticentia I', 'Meet The Concealer', 'â€œMeet The Concealerâ€ merupakan game berdasarkan cerita (narrative). Player dipaksa harus mengikuti langkah-langkah untuk dapat masuk ke dalam cerita dari game, selain itu bisa menentukan alur ceritanya sendiri, tergantung dengan pilihan portal utama mana atau pintu cerita mana yang akan ia buka terlebih dahulu atau menentukan keputusan untuk mengakhiri game yang didasarkan atas persepsi player. Game ini peruntukkan bagi player berusia 10 tahun ke atas, karena ada beberapa statement yang keluar dari kebiasaan kepatuhan sehingga berdampak pada pola pikir, dan akan sedikit mengkhawatirkan jika dimainkan oleh anak di bawah 10 tahun. Selain itu, game ini juga dibuat didasarkan atas pemasalahan, karena di luar sana masih banyak para orang tua yang memaksakan kehendak Anda, padahal setiap anak memiliki jalan hidupnya sendiri. Namun terkadang, orang tua terlalu memikirkan masa depan anak hingga hampir tak sempat untuk memikirkan apakah anak mampu menjalani hal-hal yang didoktrinkan oleh mereka. Memang anak perlu dibina sejak dini, di usia remaja atau bahkan dewasa, anak masih menjadi tanggung jawab orang tua. Nasehat orang tua akan sangat diperlukan hingga anak meninggal. Akan tetapi, ada kalanya jiwa dan raga anak lelah, mengharapkan kebebasan dalam memilih, tanpa ada kekangan. Oleh karena itu, game ini muncul untuk memberikan edukasi kepada para orang tua agar berlatih untuk memberikan kebebasan memilih kepada anak. ', 'https://youtu.be/n1m4nPRDEbA', 'https://box.biznetgiocloud.com/home/index.php/s/ZpyKivA2dHTNBS9', 'img/identitas/igdc/135150218114003_identitas.pdf', 1, 0),
(6, 120, 'ELGO', 'Yosi Aditya Nugroho', '-', 'Orivio', 'Orivio merupakan sebuah game dimana kamu harus mengalahkan rasa takutmu terhadap mata pelajaran di sekolah. ', 'https://youtu.be/kwHmHgOaMyY', 'https://www.dropbox.com/s/89ch455d6sptwux/ELGO_Orivio.zip?dl=0', 'img/identitas/igdc/13213035_identitas.pdf', 1, 0),
(8, 44, 'AXLRED STUDIO', 'Dicky Muhammad Priangga', 'Muhammad Azzam', 'STARJOUST Duel', 'Duel dalam satu perangkat. Kalahkan lawanmu! STARJOUST Duel adalah game mobile Android local mutiplayer versus dalam satu perangkat. Dua pemain akan bertanding selama 90 detik untuk meraih skor setinggi-tingginya.', 'https://www.youtube.com/watch?v=wk0l8ivNwWA&feature=youtu.be', 'https://dl.dropboxusercontent.com/u/166384594/AXLRED%20STUDIO_STARJOUST%20Duel.rar', 'img/identitas/igdc/5215100043_identitas.pdf', 1, 1),
(9, 41, 'Ai Game Studio', 'Muhammad Azmi Malik Ariefa', 'Ken Larasati', 'Dadufall', 'Siap berangkat ke sekolah? Ikuti perjuangan Umar, Gie, Meutia dan Sartika balapan ke satu-satunya sekolah di kampung mereka yang sangat jauh dan penuh dengan rintangan!', 'https://youtu.be/YC8py3ryZ0I', 'https://drive.google.com/file/d/0Bxl7ZPfIIckHNkNEZ2N6ay1HLTg/view?usp=sharing', 'img/identitas/igdc/1406576805_identitas.pdf', 1, 0),
(10, 105, 'Comical Team', 'Yunika Tartila', 'Eda Ramadhan', 'Let Me Eat!', 'insects invade your dinning table! Don''t let them touch your sweet cake!', 'https://www.youtube.com/watch?v=3fr3ROm-P74', 'https://drive.google.com/open?id=0B0cXEBPNbI7BdFBwX3JtRHhFOHc', 'img/identitas/igdc/950813432278_identitas.pdf', 1, 0),
(11, 85, 'chicken point', '-', '-', 'catch the chicken', 'pacman with puzzle', '', '', 'img/identitas/igdc/317506100798000_identitas.pdf', 1, 0),
(12, 159, 'IN.Famous Studio', 'Lazuardi Ya''qub Affan', 'Argo Dewana', 'Hoop Hoop Ninja', 'Hoop Hoop Ninja merupakan social - tradisional game yang memadukan unsur permainan tradisional (engklek) dan improved-gaming core dimana player memainkannya secara bergantian dengan player lain menggunakan 1 device. \r\nGame Rule sbb :\r\n1. Terdapat 5 karakter dengan 5 atribut berbeda dan 1 scroll\r\n2. Board terdiri dari tiles 5 X 7 dengan pembagian area yaitu start area, main board dan finish area. Main Board telah diacak attribut tilesnya.\r\n3. Player tidak bisa memilih karakter yang telah dipilih oleh player lain\r\n4. Terdapat 3 pilihan putaran/turn yaitu : 3, 5, dan 7\r\n5. Urutan permainan ditentukan di awal dengan menggunakan bingo machine, yang mendapat giliran pertama berhak untuk menaruh scroll di main board.\r\n6. Setiap karakter akan diberi health point 10\r\n7. Setiap karakter mempunyai area get moving path 1 petak di sekelilingnya\r\n8. Setiap karakter mampu menyerang/serangan normal dan 1 jutsu yang bisa digunakan 1 kali, setelah itu hanya bisa regain ketikan karakter mencapai finish area (untuk aturan serangan normal sama, tetapi setiap karakter memiliki jutsu unik mereka masing - masing)\r\n9. Objektif game adalah player harus mencapai finish area, kemudian membawa pulang kembali scroll ke start area dengan selamat, tetapi waspada ! apabila player melangkah ke tile dengan attribut yang tdk cocok dengan karakter maka health point akan berkurang 1 point. Kalian juga akan bersaing dengan player lain menggunakan serangan normal (mengurangi health 1 point) dan jutsu - jutsu yg telah di sediakan. Selamat bermain dan jadilah ninja terhebat !', 'https://www.youtube.com/watch?v=eLrHAvqhgkI&feature=youtu.be', 'https://drive.google.com/file/d/0B_Cd_1xJZST8ZEdJUGlxODF6WGM/view?usp=sharing', 'img/identitas/igdc/15650057_identitas.pdf', 1, 0),
(13, 99, 'Team Four', 'Akbar Widyoseno', 'Dwi Antini Rohmah Dea Alqarana', 'Rocky D34am', 'Sebuah game yang memperjuangkan sebuah batu dengan mewujudkan cita - cita nya yaitu menghafal angka yang bernilai satuan sampai jutaan. Game ini ditujukan untuk seorang anak yang baru akan sekolah, dengan harapan bahwa anak tersebut bisa lebih cepat untuk mengenal dan mengingat angka dari nilai satuan sampai jutaan. Game Rocky Dr34m merupakan perpaduaan antara dunia game dan pendidikan . Dan dengan game ini disiapkan untuk menuju Indonesia Emas 2045 pada masa depan Indonesia melalui pendidikan game.', 'https://www.youtube.com/watch?v=m3Qy5zSkvok', 'https://www.dropbox.com/s/rszm9ir7eqtwux0/RockyDr34ms_0.9.8.apk', 'img/identitas/igdc/4210141005_identitas.pdf', 1, 0),
(14, 154, '3GBox Games', 'Rizky Alfath Ammar Asyraf', '-', 'Purify : The Legend of Z', 'Sebuah Action Games dengan combo dan skill yang mudah digunakan dan dilatar belakangi sebuah alur cerita yang menarik.', 'https://youtu.be/BXlZ-Pl-wZk', 'https://drive.google.com/open?id=0B7BcyxQ1-Wo2aTNGb21YdHFRZWs', 'img/identitas/igdc/3302192006980002_identitas.pdf', 1, 1),
(15, 53, 'Beauty Digital', '-', '-', 'Ferminoid', '2D Action Puzzle retro style', 'https://www.youtube.com/watch?v=hpeepg79BHE', 'https://1drv.ms/u/s!ApYzWfbSZFCGgy9EtrBYXX-VEs2s', 'img/identitas/igdc/1406578205_identitas.pdf', 1, 1),
(16, 168, 'Umbrella Man Series', 'Mochamad Chaerurrezky Iqbal', 'Mindha Ningrum', 'Umbrella Man: Rainy', 'Umbrella Man: Rainy adalah sebuah permainan puzzle seorang penjual jasa ojek payung ke pelanggannya,  dimana sang umbrella man harus mengantarkan pelanggannya ke lokasi yang diinginkan disaat hujan deras. Namun, perjalanan Umbrella Man mengantarkan pelangganya tidak semudah yang dibayangkan, banyak halangan seperti jalan tertutup, preman, tukang jualan, banjir yang harus dilewatkan umbrella man dan memastikan bahwa pelanggannya baik-baik saja serta tentunya tidak terkena rintikan hujan. ', 'https://youtu.be/hthvlCtjBf8', 'https://dl.dropboxusercontent.com/u/6554469/apk_host/Umbrella%20Man%20Series_Umbrella%20Man%20-%20Rainy.rar', 'img/identitas/igdc/1103134383_identitas.pdf', 1, 0),
(17, 92, 'GINVO Studio', 'Muhammad Ikhsan Firdaus', 'Farhan Habitullah', 'Dig Alley', 'Game Arcade tentang pemberantasan terorisme', 'https://www.youtube.com/watch?v=VSHkiUaSE0A', 'https://drive.google.com/open?id=0B_KDUZHhuhusaFZBZzZNdlN0NVU', 'img/identitas/igdc/9992905801_identitas.pdf', 1, 1),
(18, 93, 'Pandanwangi Game Studio', '-', '-', 'Food4You, Inc.', 'Local-multiplayer game, dimana pemain adalah karyawan dari suatu perusahaan supplier makanan, dimana pekerjaan mereka adalah menyortir makanan yang disupplai di pabrik yang sangat sibuk.', 'https://www.youtube.com/watch?v=u6KnSIjpBac', 'https://drive.google.com/file/d/0BzfyYaHb7WhANVh1YnZfOVZVRm8/view?usp=sharing', 'img/identitas/igdc/5520114009_identitas.pdf', 1, 0),
(19, 216, 'UGD (Unis Games Developer)', 'Yusup Nur Ikhsan', '-', 'Kampoeng BlackOut', 'Survive With Blackout Condition, Sebuah Games Advanture menantang anda untuk bertahan pada kondisi mati lampu dan bertugas mengumpulkan lampu dan diganggu oleh musuh yg muncul jika mati lampu terjadi', 'https://www.youtube.com/watch?v=7RPd5dqQc5E', 'https://drive.google.com/open?id=0B5IY0Kd-EWFTb2dlaC1STnpkMUE', 'img/identitas/igdc/1404030136_identitas.pdf', 1, 0),
(20, 217, '23:59', 'Luthfi Firmansyah Soehadak', 'Ignatius Abraham Susanto', 'Mantra', 'Mantra adalah sebuah mobile game berjenis platform dengan inovasi gameplay. Pemain harus mengkombinasikan elemen elemen yang ada sehingga menghasilkan sihir untuk menyerang musuh', 'https://www.youtube.com/watch?v=bh-wihemUR0', 'https://play.google.com/store/apps/details?id=com.Leaf.Argon', 'img/identitas/igdc/5112100024_identitas.pdf', 1, 1),
(21, 171, 'MegaGames Studio', 'Ibnu Ali Mukhtarom', 'Rio Novirdian Abishah Putra', 'Cooking Frenzy', 'A Simple Cooking', 'https://youtu.be/rV5VPZS1BhI', 'https://drive.google.com/open?id=0B0Nz85iatWhzelNBNENJbVNIUGM', 'img/identitas/igdc/141524028_identitas.pdf', 1, 0),
(22, 221, 'GameProg Skanic', 'Fauzan Zidni Muzakki', 'Gaffaridzan Raudha', 'Anak Indonesia Sehat', 'Simple Game yang informatif tentang makanan sehat', 'https://www.youtube.com/watch?v=dC0-9REeNRE&feature=youtu.be&noredirect=1', 'https://drive.google.com/open?id=0B7ALc1sq65HiZml3bC1OZFZqdGs', 'img/identitas/igdc/9987399321_identitas.pdf', 1, 0),
(23, 222, 'Tim Rocket', 'Muhammad Nasirul Umam', 'Abdul Masykur', 'Mathematicats', 'Mathematicats adalah sebuah game edukasi matematika dasar. Game ini  ditujukan bagi anak-anak yang baru memulai belajar matematika dasar. Game ini  menceritakan tentang lima ekor kucing yang terlepas dari kandang kemudian pergi  dan tersesat di dalam hutan. Tugas dari pemain adalah menangkap kembali kucing  tersebut dan memasukannya ke dalam kandang. Untuk menangkap kucing dan  memasukannya ke dalam kandang, maka pemain harus menggunakan susunan  yang benar. Semakin cepat pemain menyusun kucing dalam kandang maka nilai  atau skor yang di dapatkan akan semakin tinggi. Apabila pemain salah dalam  menyusun kucing yang ditangkap maka dia diberikan kebebasan apakah ingin  menyusun ulang kembali atau keluar dari permainan. Game ini memiliki 3 level yaitu easy, medium dan hard. ', 'https://youtu.be/BP8EjWgqsXw', 'https://drive.google.com/folderview?id=0B4swsqgWmOR5dTVyYU1IbjJhdkU&usp=sharing', 'img/identitas/igdc/1102413072_identitas.pdf', 1, 1),
(24, 218, 'AD Studio', 'Aditya Putra Ferza', 'Wahyu Widyananda', 'Touch VS', 'Pemain diminta untuk mengalahkan bakteri yang ada didalam suatu lingkungan/ruangan. Cara mengalahkannya dengan memilih obat yang tepat dan memberikan kepada kuman yang tepat melalui touch. Semakin banyak mengalahkan bakteri maka skor akan bertambah. Akan tetapi, jika bakteri dibiarkan nilai health point dari pemain akan berkurang.', 'https://www.youtube.com/watch?v=NVlTjQWqCmk&feature=youtu.be', 'https://play.google.com/store/apps/details?id=com.Company.TouchVS', 'img/identitas/igdc/5112100134_identitas.pdf', 1, 0),
(25, 86, 'MataPanda Developer', 'Devy Putri Puspitasari', '-', 'Botia and Friends', 'Botia dan Friends merupakan game petualangan terinspirasi oleh ikan hias khas Jambi yang hampir punah ''Botia macracantha''. Permainan menantang pemain untuk berkolaborasi dengan Botia (dan berbagai ikan hias di Indonesia yang hampir punah) untuk melaksanakan misi penyelamatan laut Natuna dari "desctructive dan illegal fishing".', 'https://youtu.be/I1s1a8XK6Vc', 'https://drive.google.com/folderview?id=0B7ts1ezicL4xNEtycnM2Y0tQVG8&usp=sharing', 'img/identitas/igdc/55412123_identitas.pdf', 1, 1),
(26, 220, 'Syampun', 'Irna Arlianti', 'Wahyu Widyananda', 'Kedai 787', 'Game mini tycoon untuk mengenalkan jenis masakan-masakan yang ada di Indonesia', 'https://drive.google.com/open?id=0B26Oi_HH-VXiel9fbmpNVGQ2Q28', 'https://drive.google.com/open?id=0B26Oi_HH-VXiZDJIMW5CYXdfTGM', 'img/identitas/igdc/3573052507940006_identitas.pdf', 1, 0),
(27, 282, 'Stikom Surabaya', 'Cynthia Anggun Hapsari', 'Angelina Febrianti', 'Selendang', 'Game dengan genre Tower Defense yang diadaptasi dari cerita rakyat Jaka Tarub, game ini berfungsi sebagai media yang atraktif dan interaktif agar cerita rakyat Nusantara tetap lestari dan dikenal oleh masyarakat Indonesia', 'https://youtu.be/4rd_qHlhlDs', 'https://drive.google.com/open?id=0B12DrQap-IhAalNtSmdrRGE1Mjg', 'img/identitas/igdc/13510160031_identitas.pdf', 1, 1),
(28, 281, 'Ramagarya', 'Widi Aryaguna Putra', 'Wiradani Ramadhan', 'Pahlawan Nusantara', 'Endless Run Game yang bertemakan perjuangan tentara Indonesia dalam menggapai kemerdekaan.', 'https://youtu.be/Cii9CvjPRQs', 'https://drive.google.com/file/d/0B2qty_8x2pIrVkFxVUxvTmtpUTg/view?usp=sharing', 'img/identitas/igdc/G64150005_identitas.pdf', 1, 0),
(29, 164, 'ADA Game Studio', 'Rakhmat Sabarudin', 'Jessica Florencia', 'Tapto', 'Game runner yang mengajarkan teknologi dan puzzle yang menarik', 'https://youtu.be/R68aWGvdefc', 'https://play.google.com/store/apps/details?id=com.adags.tapto', 'img/identitas/igdc/10115387_identitas.pdf', 1, 1);
