(879, 13, 94, 'If a system does not interact with its environment in any way, then certain mechanical properties of the system cannot change. They are sometimes called &quot;constants of the motion&quot;. These quantities are said to be &quot;conserved&quot; and the conservation laws which result can be considered to be the most fundamental principles of mechanics. In mechanics, examples of conserved quantities are energy, momentum, and angular momentum. The conservation laws are exact for an isolated system.', 'http://hyperphysics.phy-astr.gsu.edu/hbase/conser.html', 0, '2016-09-11 06:24:41'),
