(1083, 42, 84, 'Albacete dalam kelanjutan pertandingan La Liga di musim 2004/2005. Blaugrana masih dilatih oleh Frank Rijkaard asal Belanda. Barca masih unggul dengan skor 1 â€“ 0. Jelang pertandingan berakhir, Rijkaard memasukkan pemain mudanya yang masih berusia 17 tahun, dialah Lionel messi yang menggantikan posisi Samuel Etoâ€™o. Messi memang seorang striker dengan insting menciptakan gol sebanyak mungkin. Sebelum pertandinan bubaran, umpan matang dari Ronaldinho bisa dimanfaatkan dengan sempurna oleh Messi untuk menjebol gawang lawan sekali lagi. Skor berubah menjadi 2 â€“ 0 untuk kemenangan Barcelona. Setelah pertandingan tersebut dan berhasil mencetak gol, Messi seperti tersulut untuk lebih berlatih keras. Hasilnya memang sangat luar biasa karena Messi menjadi pemain pencipta gol terbanyak di Barcelona sepanjang massa. Rekor Messi berhasil membuat 418 gol dari 492 pertandingan yang dilakoninya bersama Barca.', 'https://www.google.com/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;uact=8&amp;ved=0ahUKEwjyybWi2IbPAhVHrY8KHSMfAYoQFggcMAA&amp;url=http%3A%2F%2Fwww.agensbobet888.com%2Fbagaimana-gol-pertama-messi-di-barcelona-tercipta%2F&amp;usg=AFQjCNFyPO88EtpAReXozHZSb3Rh2qQ-vg&amp;sig2=SFQoxRVKjFU_t_JQvRRs7Q&amp;bvm=bv.132479545,d.c2I', 0, '2016-09-11 06:31:23'),
