(1788, 30, 101, 'The Cafe buka untuk breakfast, lunch dan dinner. Kami mencoba buffet lunch pada kunjungan kami ini. Lebih baik sebelum datang ke The Cafe melakukan reservasi terlebih dahulu karena peminatnya yang cukup banyak. Harga buffet lunch dan dinner di The Cafe terpaut tiga puluh ribu lebih mahal pada malam hari tetapi jam makan yang lebih panjang di malam yaitu antara jam 18.00-22.30 WITA dibandingkan lunch yang cuma 12.00-14.30 WITA. Kesan pertama memasuki restoran The Cafe adalah interior yang luas dan penempatan makanan yang berjauhan. Tidak seperti restoran di hotel-hotel pada umumnya yang penataan makanannya saling berdeketan, The Cafe menawarkan banyak ragam pilihan makanan sehingga penempatannya saling berjauhan.', 'http://johntek.blogspot.co.id/2014/11/the-cafe-hotel-mulia-bali.html', 0, '2016-09-11 06:54:44'),
