(67, '<p>Kantong plastik digunakan untuk memuat dan membawa barang konsumsi. Bagian dasar dan sisi kiri/kanan kantong umumnya direkatkan dengan mesin penyegel plastik, namun ada kantong plastik yang disatukan dengan&nbsp;perekat atau dijahit. Kantong plastik&nbsp;atau&nbsp;tas plastik&nbsp;adalah kantong pembungkus yang dibuat dari&nbsp;plastik jenis &hellip;.</p>\r\n', 'poliolefin;polivinil klorida', 'https://id.wikipedia.org/wiki/Kantong_plastik'),
