(69, '<p>Partai Golkar tanpa tedeng aling-aling mendeklarasikan dukungan untuk mencalonkan Joko Widodo (Jokowi) pada Pilpres 2019 di hadapan Ketum PDIP Megawati Soekarnoputri. Deklarasi itu dibacakan dalam &hellip;.</p>\r\n', 'Penutupan Rapimnas I Golkar', 'http://news.detik.com/berita/3263964/soal-dukungan-golkar-di-pilpres-2019-ini-respons-jokowi'),
