(72, '<p>Rio Haryanto menyambut kesempatan dari Manor Racing untuk&nbsp;tetap mengikuti perlombaan Grand Prix Jerman di Sirkuit Hockenheim pada Minggu (31/7) dengan konsentrasi penuh dan mengenyampingkan semua spekulasi mengenai masa depannya dalam Formula Satu. Padahal, Rio belum dapat memenuhi kekurangan dana sebesar &hellip;. Euro</p>\r\n', 'Tujuh Juta;7 Juta;7.000.000;7000000', 'http://www.aktual.com/dana-cekak-pemerintah-serahkan-nasib-rio-haryanto-ke-manor/'),
(73, '<p>Kapolri Jenderal Badrodin Haiti yang pensiun pada bulan Juni 2016, digantikan dengan Komjen Pol. Budi Gunawan yang sebelumnya menjabat sebagai &hellip;.</p>\r\n', 'Wakil Kapolri;Wakil Kepala Polisi Indonesia;Wakil Kepala Polisi Republik Indonesia;Wakapolri', 'http://www.rappler.com/indonesia/117920-8-isu-yang-diprediksi-akan-menghangat-tahun-2016'),
(74, '<p>Presiden Joko Widodo mengumpulkan ratusan kepala kantor pelayanan pajak seluruh Indonesia di Istana Negara, Kamis (28/7). Presiden meminta mereka membantu pemerintah dalam menyukseskan program&nbsp;<em>tax amnesty</em>&nbsp;alias pengampunan pajak. Orang &ndash; orang penting yang turut hadir diantaranya &hellip;.</p>\r\n', 'Darmin Nasution,Sri Mulyani,Bambang Brodjonegoro;Darmin Nasution, Sri Mulyani, Bambang Brodjonegoro', 'http://www.republika.co.id/berita/inpicture/nasional-inpicture/16/07/28/ob11nq283-ratusan-petugas-pajak-diminta-jokowi-sukseskan-tax-amnesty'),
