(94, '<p>&iquest;Qu&eacute; dice la ley de conservaci&oacute;n de la?&nbsp;&nbsp; (Jawablah soal ini dengan bahasa inggris)</p>\r\n', 'The law of conservation of mass, or principle of mass conservation, states that for any system closed to all transfers of matter and energy (both of which have mass), the mass of the system must remain constant over time, as system mass cannot change quantity if it is not added or removed.', 'http://www.buenastareas.com/ensayos/50-Preguntas-De-Quimica-3-Secundaria/1869693.html;http://en.wikipedia.org/wiki/Conservation_of_mass'),
(95, '<p>Mahasiswa Institut Pertanian Bogor yang bernama Maman ingin melakukan penelitian di daerah Surabaya, tetapi ia tidak mengetahui jarak (miles) dari Bogor Agricultural University menuju Gerbang tol Surabaya. Berapa jarak (miles) ketika ia mengemudi mobil dari IPB ke Gerbang tol Surabaya?</p>\r\n', '512 miles;512', 'https://www.google.co.id/maps/dir/Bogor+Agricultural+University,+Kota+Bogor,+Java+Barat+16680/Gerbang+Tol+Suranbaya/@-6.6870906,105.3702869,6z/data=!3m1!4b1!4m15!4m14!1m5!1m1!1s0x2e69c5ccc044bda1:0x728537633329145e!2m2!1d106.801085!2d-6.5879!1m5!1m1!1s0x2dd7f845acca8dad:0x90868e3e04f2bab3!2m2!1d112.77825!2d-7.21224!4e1!5i1?hl=en'),
(96, '<p>Pada video chanel ariefmuhammad yang diposting tanggal 1 September 2016 ini, Arief dan kawan - kawan ingin mengunjungi salah satu daerah penghasil biji kopi di Indonesia, di daerah tersebut terdapat satu air terjun yang terkenal, apa nama air terjun tersebut?</p>\r\n\r\n<div class="embeddedContent oembed-provider- oembed-provider-youtube" data-align="none" data-oembed="https://www.youtube.com/watch?v=18M8fQ9I4V0" data-oembed_provider="youtube" data-resizetype="noresize"><iframe allowfullscreen="true" allowscriptaccess="always" frameborder="0" height="349" scrolling="no" src="//www.youtube.com/embed/18M8fQ9I4V0?wmode=transparent&amp;jqoemcache=vDQFc" width="425"></iframe></div>\r\n\r\n<p>&nbsp;</p>\r\n', 'Air terjun Lembah Pelangi', 'http://www.suara.com/lifestyle/2015/06/29/001200/mengejar-pelangi-di-air-terjun-ulubelu-tanggamus'),
(97, '<p>Jatna Supriatna merupakan salah satu penulis buku yang menceritakan tentang pelestarian alam indonesa, pada halaman berapa menjelaskan tentang pengaruh pulau terhadap kekayaan jenis?</p>\r\n', 'Halaman 7;7', 'https://books.google.co.id/books?id=VX0crY5PkFYC&printsec=frontcover&dq=Indonesia&hl=id&sa=X&redir_esc=y#v=onepage&q=Indonesia&f=false'),
