(100, '<p><em>n. the realization that each random passerby is living a life as vivid and complex as your own&mdash;populated with their own ambitions, friends, routines, worries and inherited craziness&mdash;an epic story that continues invisibly around you like an anthill sprawling deep underground, with elaborate passageways to thousands of other lives that you&rsquo;ll never know existed, in which you might appear only once, as an extra sipping coffee in the background, as a blur of traffic passing on the highway, as a lighted window at dusk.</em></p>\r\n\r\n<p>Merupakan pengertian dari?</p>\r\n', 'Sonder', 'http://ilcongabstrak.blogspot.co.id/2016/08/sonder.html'),
(101, '<p>The Cafe - Hotel Mulia merupakan salah satu restauran terkenal, restauran ini dikenal karena memiliki fasilitas?</p>\r\n', 'All day international buffet', 'https://www.zomato.com/id/jakarta/the-cafe-hotel-mulia-senayan'),
